"use strict";(globalThis.webpackChunknumerology=globalThis.webpackChunknumerology||[]).push([[628],{5907(e){e.exports=JSON.parse('{"tag":{"label":"basics","permalink":"/docs/tags/basics","allTagsPath":"/docs/tags","count":8,"items":[{"id":"Basics/Birthday number","title":"Birthday number","description":"In numerology, the Birthday number (also called Birth Day number) is simply the day of the month you were born, treated as its own special energy.","permalink":"/docs/Basics/Birthday number"},{"id":"Basics/Chart","title":"Chart","description":"A chart (often called a numerology birth chart,numerology chart or numeroscope) is a structured layout of key numbers derived from your birth date and full birth name.  It serves as a \u201cmap\u201d of your personality, life path, strengths, challenges, and potential destiny, much like an astrological birth chart does for planets and signs.","permalink":"/docs/Basics/Chart"},{"id":"Basics/Core","title":"Core","description":"The \u201ccore\u201d refers to the five main numbers that form the foundation of your chart and are considered the most important influences in your life.","permalink":"/docs/Basics/Core"},{"id":"Basics/Expression","title":"Expression","description":"Expression number (also called the Destiny number or Personality number) is a Core number derived from the letters in your full birth name.","permalink":"/docs/Basics/Expression"},{"id":"Basics/Life Path","title":"Life Path","description":"Life Path number is considered the most important \u201ccore\u201d number in your chart; it is derived from your full date of birth and is said to reveal your life purpose, key traits, and the main lessons you are here to learn.","permalink":"/docs/Basics/Life Path"},{"id":"Basics/Master Numbers","title":"Master Numbers","description":"Master Numbers are special double\u2011digit numbers that are not reduced to a single digit (1\u20139) because they\u2019re believed to carry a higher, more intense Vibration. The three main Master Numbers are 11, 22, and 33, and they often appear in core positions like Life Path, Expression, or Soul Urge numbers.","permalink":"/docs/Basics/Master Numbers"},{"id":"Basics/Personality","title":"Personality","description":"Personality Number (also called the \u201couter personality\u201d or \u201cfirst impression\u201d number) shows how you naturally come across to others and how people tend to see you before they really know you. It is one of the Core numbers in a numerology Chart, alongside Life Path, Expression, and Soul Urge.","permalink":"/docs/Basics/Personality"},{"id":"Basics/Soul Urge","title":"Soul Urge","description":"Soul Urge (also called Heart\u2019s Desire or Soul Number) reveals what you truly long for on the inside: your deepest desires, motivations, and emotional needs.\xa0 It shows what feels most meaningful to you, even if it doesn\u2019t match how you appear on the outside.","permalink":"/docs/Basics/Soul Urge"}],"unlisted":false}}')}}]);